description:
Parse a string of mathematical expression using Sprache library and evaluate it. Additional functions and variables can be defined and customized before evaluation.
Example code: 
  new ExprBuilder().Eval("1+2+3");
  new ExprBuilder().SetVar("pi", c => Math.PI).Eval("pi/2");

